import axios from "axios"

class EntryService {

    async createEntry(json) {

        const axiosConfig = {
            headers: {
                'Content-Type': 'application/json;charset=UTF-8',
                "Access-Control-Allow-Origin": "*",
            }
        };

        const response = await axios.post("http://localhost:8102/entries/save", json, axiosConfig);
        return response.data;
    }

    async getUserEntries() {

        const axiosConfig = {
            headers: {
                'Content-Type': 'application/json;charset=UTF-8',
                "Access-Control-Allow-Origin": "*",
            }
        };

        const response = await axios.post("http://localhost:8102/entries/users", json, axiosConfig);
        console.log(response);
        return response.data;
    }

}

export default new EntryService();
